INSERT  INTO `reminder_note`(`id`,`notes`) VALUES (6,'<ul>\r\n	<li>\r\n	<p><em><span style=\"font-family:verdana,geneva,sans-serif\"><span style=\"font-size:10px\"><small>Late Payment Policy: A service charge of $10.00 will be applied to the account of parents\\clients who continuously fail to pay for lessons after the 1st week of the month.</small></span></span></em></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"font-size:10px\"><em><small><span style=\"font-family:verdana,geneva,sans-serif\">Cancelation Policy: Arcadia must be notified by no later than 8:00pm on the day prior to a scheduled lesson. Doctor&#39;s note is required, in all other situations. Failure to provide a doctor&#39;s note will result in the loss of the lesson for the day. If a student cancels more than once in a month, those lessons will be lost unless a doctor&#39;s note is provided</span></small>.</em></span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"font-size:10px\"><span style=\"font-family:verdana,geneva,sans-serif\"><small><em>SPECIAL NOTE: Please notify Arcadia in writing two weeks before the last of the month if your intentions are to discontinue your child&#39;s lessons. Otherwise, the fee for the next month is due as payable. ONE MONTH in advance if your child will be absent during the summer months.</em></small></span></span><span style=\"font-size:10px\"><span style=\"font-family:verdana,geneva,sans-serif\"><small><em>​</em></small></span></span><em><small><span style=\"font-family:verdana,geneva,sans-serif\"><span style=\"font-size:10px\">&nbsp;</span></span></small></em></p>\r\n	</li>\r\n</ul>\r\n');
COMMIT;

